import React from "react";

function App(){
   
   const InputValue=(event)=>{
    console.log(event.target.value);

   }
   return(
      <>
      <div className="container">
         <div className="inner">
         <h1>Hello </h1>
         <input type="text" placeholder="Enter Your Name"
            onChange={InputValue}
         />
         <br/>
         <button>Click Me</button>
         </div>
      </div>

      </>
   );
}
export default App;
